Gerne Liebe da lassen 🤍

Produkte:
@mixa Urea Cica Repair Creme
Kann täglich als Pflege verwendet werden und ist hornhauterweichend und pflegend! Achtung: leicht parfümiert, aber enthält keine reizenden deklarierungspflichtigen Duftstoffe

@Eucerin Deutschland - Urea Repair 10%
Ist auch perfekt für die tägliche Pflege und ist unbeduftet. Durch die hohe Konzentration von Urea wirkt das Produkt auch leicht peelend. Enthält außerdem einen pflegenden Komplex aus natürlichen Feuchtigkeitsfaktoren (NMF).

@dm-drogerie markt - Schrunden Salbe
Nur für 1-2x die Woche, da stark peelend.

@eucerin_de - Urea Repair 30%
Nur für 1-2x die Woche, da stark peelend.

@Biotherm - Biocorps Serum
Super mildes pflegendes Serum, das Säuren enthält, die chemisch peelend wirken. Außerdem enthält das Produkt hier den patentierten Life Plankton Wirkstoff, der regenerierend und stärkend wirkt.

@eucerin_de - BHA Waschgel
Enthält eine öllösliche Säure, die Poren verfeinert und Unreinheiten vorbeugt. Außerdem peelt es. Da es nur kurz als Waschgel auf dem Gesicht ist, ist es nicht soooo wirkungsvoll, aber auch nicht so aggressiv. 

@neutrogena - AHA Peeling
Super Toner für 2-3x die Woche. Peelt die oberste Hautoberfläche, wodurch die Haut weicher wird und weniger verstopft.

@Paula’s Choice DE AT - 2% BHA Liquid
Ähnlich wie das Waschgel. Nur bleibt das Produkt drauf und wird nicht runtergewaschen. Deshalb wirkungsvoller. Ist super zum kombinieren mit AHA. 

@Geek & Gorgeous - 12% Smooth Out
Mein Favorite, aber auch das stärkste Peeling!2x die Woche reicht. 

