Unbezahlte Werbung*

#hautpflege #skincare #drogerie #drogerieneuheit #hautbarriere #hautpflegetipps

Einer der hartnäckigsten Hautprobleme sind tatsächlich Pigmentflecken. Um sie loszuwerden, muss man verstehen woher sie kommen. Dabei richten sich die Produkte auf die ersten 2 Arten (Pickelmale und Melasmen) 🔬🤍

Genaue Produktempfehlungen hier⬇️⬇️

Thiamidol:
@Eucerin Deutschland - Anti Pigment Dual Serum für das Gesicht und die Körpercreme enthalten beide den patentierten Wirkstoff Thiamidol.

Vitamin C (pure Ascorbinsäure):
Da sind meine 2 Favoriten beide aus der Drogerie. Teurere, die ich kenne können damit definitiv nicht mithalten oder sind gleich auf. Deshalb sind das seit über 2 Jahren meine Go-To Produkte.

@Geek & Gorgeous - C-Glow ist stark formuliert (15%) und nichts für sensible Haut, dafür die stärkste Wirkung.
@L’Oréal Paris - Enthält weniger Vitamin C (12%) und hat einen wenig sauren pH-Wert, deshalb weniger reizend, aber auch schwächer in der Wirkung.

Niacinamide:
Hier benutze ich selber lieber Cremes, die Niacinamide enthalten, da extra Seren für mich ein unnötiger Step sind. Trotzdem stelle ich euch beides vor! 

@Rossmann Isana - Overnight Serum enthält 5% Niacinamide. Finde es leicht klebrig aber sonst gut.

@Vichy Laboratoires - Liftactiv Creme ist eigentlich ein Anti Aging Produkt mit Peptiden. Enthält aber auch 4% Niacinamide. Also ein All Rounder Produkt.

@MIXA - Niacinamide Bright Creme für den Körper kommuniziert die genaue Nia Konzentration nicht. Jedoch liegt nahe, dass es mindestens 4% sein müssen, wenn nicht sogar mehr.

@Niche Beauty Lab Transparent Lab - Niacinamide Glow Cream enthält 5% Niacinamide und eine tolle Gelcreme.

@neutrogena_deutschland - AntiPickel+ Gelcreme enthält 4% Niacinamide und ist die günstigere Alternative zu Neutrogena.

@Loreal Paris - Bright Reveal Serum Hier bekommt ihr noch ein gutes Drogerie Serum, was 7,5% Niacinamide und Aminosulfonsäure enthält. Die Kombi ist auch sehr potent bei Pigmentflecken und unreiner Haut.

Chemische Peelings:

@Biotherm - Biocorps ist ein mildes aber pflegendes Körperserum, was die Haut peelt und gleichzeitig regeneriert. Ist mein persönlicher Favorit mit dem patentierten Life Plankton (1%) Wirkstoff, der die Hauterneuerung zusätzlich beschleunigt. 

@Geek&Gorgeous - Smooth Out ist ein sehr starkes chemisches Peeling mit insgesamt 12% (AHA +PHA). Die Marke hat aber auch mildere für empfindlichere Haut.

@Paula’s Choice DE AT - 2% BHA benutze ich seit bestimmt 6 Jahren und ist mein Favorit BHA Peeling. Es beugt auch Unreinheiten vor, indem es den Talg aus der Pore löst. Kann man (wenn man es verträgt) mit AHA Peeling zusammen auftragen.

Retinoide:

@Paula’s Choice - 1% Clinical Retinol ist die höchste zulässige Konzentration an Retinol. Sehr potent aber auch sehr wirkungsvoll.

@Geek&Gorgeous - 0,05-0,2 % Retinal enthält eine weitere Stufe von Retinoid, was schneller und besser wirken soll (Daten Lage ist noch dünn). Die Marke hat hier verschiedene Stärken, je nach haut).

@The Ordinary - 0,2% Retinal ist für Profis und enthält ebenfalls die weitere Stufe.

Sonnenschutz:
Ausführliche Reviews findet ihr in meinen Insta Story Highlights und in meiner TikTok Playlist „Sonnenschutz“.
@La Roche-Posay @Garnierdeutschland @Cetaphil DE @Colibri Skincare 

